webpackJsonp([0xfc0fb079f138],{7917:function(e,t){e.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/713705615/" title="Photo Sharing"><img src="http://farm2.static.flickr.com/1285/713705615_bd4411f028.jpg" width="500" height="460" alt="5555mtr" /></a></p>\n<p>We\'re still way too busy to catch our breaths, but I thought I\'d show the "directional" sign we\'ve commissioned. You\'ll see this when you drive into Buchholz on the Lüneburger Strasse, from Jesteburg. Since the McCafé won\'t be ready for a few months, we\'ll paste a "Coming in December" sticker over the McCafé logo. Hopefully it will raise some curiosity.</p>\n<p>Since we\'ll see the sign every day when we drive to work, it will also serve as a quick shot of daily motivation.</p>',fields:{title:"Coming Soon",date:"04 Jul 2007",url:"https://papascott.de/2007-07-04-coming-soon/"}}},pathContext:{slug:"/2007-07-04-coming-soon/",prev:{fields:{title:"Our Name On The Door",date:"01 Jul 2007",slug:"/2007-07-01-our-name-on-the-door/"}},next:{fields:{title:"Here is Your Receipt",date:"09 Jul 2007",slug:"/2007-07-09-here-is-your-receipt/"}}}}}});
